subroutine iotk_write_dat_CHARACTER1_9(unit,name,dat,fmt,ierr)
  use iotk_base, stupid => iotk_write_dat_CHARACTER1_9
  implicit none
  integer,                intent(in)  :: unit
  character(*),           intent(in)  :: name
  CHARACTER (kind=__IOTK_CHARACTER1,len=*), intent(in)  :: dat (:,:,:,:,:,:,:,:,:) 
  character(*), optional, intent(in)  :: fmt
  integer,      optional, intent(out) :: ierr
  integer :: ierrl,wsize,wkind,wlength
  logical :: binary
  integer(iotk_header_kind), parameter :: idummy=0
  character(300) :: usefmt,usefmt1
  character(iotk_attlenx) :: attr
  ierrl = 0
  call iotk_inquire(unit,binary=binary,ierr=ierrl)
  if(ierrl/=0) goto 1
  usefmt = "!"
  if(present(fmt)) usefmt = fmt
  wsize = iotk_size(dat)
  wkind = kind(dat)
  wlength = iotk_len(dat)
  call iotk_write_attr(attr,"type",lowercase("CHARACTER"),first=.true.,ierr=ierrl)
  if(ierrl/=0) goto 1
  call iotk_write_attr(attr,"size",wsize,ierr=ierrl)
  if(ierrl/=0) goto 1
  if(binary) call iotk_write_attr(attr,"kind",wkind,ierr=ierrl)
  if(ierrl/=0) goto 1
  call iotk_write_attr(attr,"len",wlength,ierr=ierrl)
  if(ierrl/=0) goto 1
