  call iotk_write_begin(unit,name,attr,ierrl)
  if(ierrl/=0) goto 1
  if(binary) then
    write(unit,iostat=iostat) idummy,dat
  else
    usefmt = iotk_wfmt("CHARACTER",kind(dat),1,-1,usefmt)
    if(usefmt=="*") then
      write(unit,*,iostat=iostat) dat
    else
      write(unit,fmt=usefmt,iostat=iostat) dat
    end if
  end if
  if(iostat/=0) ierrl = __LINE__
