  integer, intent(in) :: wlen
  character(*), intent(in) :: fmt
  integer(iotk_header_kind), intent(out) :: idummy
  integer, intent(out) :: iostatl
  CHARACTER (kind=kind(dat), len=wlen) :: dattmp &
 __BOUNDS_9(dat) ;
  if(binary) then
    read(unit,iostat=iostatl) idummy,dattmp
