  if(wlen <= iotk_len(dat)) then
    dat (:,:,:,:,:,:,:,:,:) = dattmp (:,:,:,:,:,:,:,:,:)
  else
    dat (:,:,:,:,:,:,:,:,:) = dattmp (:,:,:,:,:,:,:,:,:) (1:iotk_len(dat))
